import React from 'react';
import styled from 'styled-components';
import {ShoppingCartOutlined} from '@material-ui/icons'

const Container = styled.div``

const Product = ({item}) => {
  return (
      <Container>
        <Circle/>
        <Image src={item.img}/>
        <Info>
          <Icon>
            <ShoppingCartOutlined/>
          </Icon>
        </Info>
      </Container>
  )
}

export default Product;
